@AutomationSendMailValidator
@ApiModel(value = "SendMailRequestDTO", description = "Request body for storing PDF as base64 String")
public class SendMailRequestDTO {

    @ApiModelProperty(value = "BASE 64 string of report pdf file", required = true,
                    example = "")
    private String fileBase64Data;

    public String getFileBase64Data() {
        return fileBase64Data;
    }

    public void setFileBase64Data(String fileBase64Data) {
        this.fileBase64Data = fileBase64Data;
    }

    @Override
    public String toString() {
        return "SendMailRequestDTO [fileBase64Data=" + fileBase64Data + "]";
    }

}
